import React, { useEffect, useState } from "react";
import axios from "axios";
import GoogleMapReact from "google-map-react";

const GoogleMap = () => {
  const [hospitals, setHospitals] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          `https://maps.googleapis.com/maps/api/place/nearbysearch/json?location=YOUR_LATITUDE,YOUR_LONGITUDE&radius=5000&type=hospital&key=AIzaSyCjRBEiBB5qHoY10iZoJ8KA4UH9fvH8V-0`
        );
        setHospitals(response.data.results);
      } catch (error) {
        console.log(error);
      }
    };

    fetchData();
  }, []);

  return (
    <div style={{ height: "400px", width: "100%" }}>
      <GoogleMapReact
        bootstrapURLKeys={{ key: "YOUR_API_KEY" }}
        defaultCenter={{ lat: 34.688404, lng: YOUR_LONGITUDE }}
        defaultZoom={13}
      >
        {hospitals.map((hospital) => (
          <div
            key={hospital.id}
            lat={hospital.geometry.location.lat}
            lng={hospital.geometry.location.lng}
            style={{
              height: "10px",
              width: "10px",
              backgroundColor: "red",
              borderRadius: "50%",
            }}
          />
        ))}
      </GoogleMapReact>
    </div>
  );
};

export default GoogleMap;
